  \"2015-08-24T21:40:25.451330\",\n\t\"name\": \"arc-code-ti-accept\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"ACCEPT consists of an overall software infrastructure
  framework and two main software components. The software infrastructure framework
  consists of code written to pre-process data, pass information between the two main
  software components, learn models that will be shared by nearly all of the elements
  in one of the two software components (which will require calling third party open
  source software modules), and select which element/method should be used in each
  one of the two main software components. The two main software components can use
  interchangeable software elements that enable the regression and detection functionality.
  Some software elements are distributed with the initial release, while others need
  to be called separately as independent third party elements that have been open
  sourced already.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
